import "../styles/compile/tailwind.css";
import AppLayout from "../components/AppLayout";

function MyApp({ Component, pageProps }) {
  return (
    <AppLayout>
      <Component {...pageProps} />
    </AppLayout>
  );
}

export default MyApp;
